class Solution:
    def numberOfSubstrings(self, s: str) -> int:
        counter = 0
        for i in range(len(s) - 2):
            end_of_word = s[i:]
            #print(f"end_of_word = {end_of_word}")
            have_found_letter = {'a': False, 'b': False, 'c': False}
            have_found_abc = False
            multiplier = 1
            for letter in end_of_word:
                if not have_found_abc:
                    if letter in have_found_letter:
                        have_found_letter[letter] = True
                    if have_found_letter['a'] and have_found_letter['b'] and have_found_letter['c']:
                        have_found_abc = True
                else:
                    multiplier += 1
            if have_found_abc:
                counter += multiplier
            #print(f"\n{end_of_word} multiplier = {multiplier}")
        return counter

            


if __name__ == '__main__':
    solution = Solution()
    word = ""
    expected_output = 3
    print(f"Input: word = {word}")
    result = solution.numberOfSubstrings(word)
    print(f"Output: {result} \nExpected output: {expected_output}")
        